📘ACQUISTA IL NOSTRO LIBRO QUI: https://amzn.to/3kVDlIz
Una domenica freschina qui da noi, ma calda in quanto a notizie. Assurdo, anzi, che ad agosto ci siano notizie così potenti. Solitamente non succedeva, gli scorsi anni. Meglio così. Quindi, buona domenica con le NEWS DELLA SETTIMANA, come ogni settimane, da tantissime settimane a questa parte, ormai.

INDICE DELLE #NEWS VIDEOGIOCHI:
0:00 - Intro gioviale;
0:12 - Risposta a Zeb89 che non è una risposta a Zeb89 ma a tanti di voi;
2:03 - Nintendo Direct Partner Showcase 2025: tutti gli annunci più importanti;
3:10 - Censura dei giochi per adulti: Visa e MasterCard hanno risposto;
4:37 - Sony denuncia Tencent per Light of Motiram. L'accusa è di plagio;
6:04 - I giochi Xbox dominano la TOP 5 dell'ultimo trimestre di PS5;
6:42 - Fan di PlayStation infuriati perché Sony vuole (forse) pubblicare i suoi giochi su Xbox e Nintendo Switch. Sony risponde;
8:51 - L'ultra realismo nei videogiochi ha rovinato tutto? Sì, secondo un ex Naughty Dog;
10:31 - BioShock 4: lo sviluppo procede malissimo, secondo fonti attendibili;
11:07 - Nintendo aumenta i prezzi di Switch, Switch OLED, Switch Lite e altri prodotti, in USA;
12:55 - Cyberpunk 2077 al lancio faceva schifo? Meglio così, secondo CD Projekt;
14:21 - Warner Bros. vuole fare un altro live service sull'universo DC?
15:07 - Clair Obscur: il team di Sandfall non vuole espandersi per il futuro;
15:29 - Annunciato, con teaser trailer, Darksiders 4;
15:52 - Leggende Pokémon Z-A: ecco il combattimento in azione;
16:08 - Gothic Remake mostrato con un nuovo trailer di gameplay;
16:23 - Sacred 2 annunciato in versione remaster;
16:33 - Battlefield 6: tutte le novità e trailer incredibili;
17:11 - PlayStation Plus Essential: i tre giochi "gratis" dal 5 agosto 2025;
17:21 - Epic Games Store: ecco i giochi GRATIS dal 7 agosto 2025;
17:28 - Saluti piuttosto standard ma accompagnati da una sorella di qualità

…
- Raiden & Midna

